  render() {
    const { estado } = this.state;
    return( 
      <div>
        <button className="testButton_01" type="button"><img src="images/logoEpicGamesOptimizado.svg" /></button>

        <button className="testButton_02" type="button">false</button>
      </div>
      )
  }
}













export default Test;
